import React from 'react';
import styled from 'styled-components';

const Card = styled.div``;
const Content = styled.div``;
const Image = styled.img``;
const Button = styled.button``;
const PostCard = ({ post }) => {
	return (
		<div>
			<Card>
				<Image />
				<Content></Content>
				<Button>리트윗</Button>
				<Button>좋아요</Button>
				<Button>더보기</Button>
			</Card>
		</div>
	);
};

export default PostCard;
